import axios from "axios";
import Layout from "../components/Layout";
import { useRouter } from "next/router";
import { route } from "next/dist/next-server/server/router";

const Another = () => {
  const router = useRouter();
  return (
    <Layout>
      <h1>지인들</h1>
      <button
        onClick={() => {
          router.push("./");
        }}
      >
        Home
      </button>
    </Layout>
  );
};

export default Another;
